UML:TaggedValue.value:
Person who needs another person to act on his/her/its behalf. 

Additional Information: 

1. The term "mandator" is thus an "umbrella-word" covering the sense of "person that is being surrogated (e.g. replaced, represented, etc.) in a given situation". 
2. Persons may be Natural Persons or Legal Persons;
3. The mandator is not necessarily the person that empowers the mandatee;
4. The mandator is not necessarily the creator of the mandate.
